import React from 'react';
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';

const JournalFormText = ({ text, handleTextChange }) => {
  return (
    <Grid item xs={12}>
      <TextField
        label="Write here."
        value={text}
        onChange={handleTextChange}
        fullWidth
        multiline
        rows={4}
      />
    </Grid>
  );
};

export default JournalFormText;
